const AuthModal = () => {
  return (
    <div className="auth-modal">
      <div className="auth-modal__container">
        <input
          type='email'
          placeholder='이메일을 입력해주세요.'
          className='auth-modal__email-input'
        />
      </div>
    </div>
  )
}

export default AuthModal;
